  const handleSubmit = (e) => {
    e.preventDefault();
    // createCanvas();
  };
  return (
    <div>
      <span>Canvasを作る</span>
      <form onSubmit encType="multipart/form-data">
        <TextField
          id="outlined-basic"
          label="Canvas名"
          variant="outlined"
          required
          onChange
        />
        <ColorButton type="submit">Canvas作成</ColorButton>
      </form>
    </div>
  );
};

export default CreateCanvas;
